// Assume the initial balance for payer and recipient is known
const initialPayerBalance = 500;
const initialRecipientBalance = 100;
const paymentAmount = 50;
const recipientUsername = 'recipientUser';
const paymentNote = 'Test payment';
// Initiate payment
cy.initiatePayment(recipientUsername, paymentAmount, paymentNote);
// Verify that the payment is listed in the payment history
cy.getBySel('nav-personal-tab').click();
cy.contains(paymentNote).should('be.visible');
// Verify the balances are updated correctly
cy.getBySel('sidenav-balance').invoke('text').then(balanceText => {
  const payerBalance = parseFloat(balanceText.replace('$', ''));
  expect(payerBalance).to.equal(initialPayerBalance - paymentAmount);
});
// Assuming we can log out and log in as the recipient to verify their balance
cy.getBySel('sidenav-signout').click();
cy.login('recipientUser', 'password123');
cy.getBySel('sidenav-balance').invoke('text').then(balanceText => {
  const recipientBalance = parseFloat(balanceText.replace('$', ''));
  expect(recipientBalance).to.equal(initialRecipientBalance + paymentAmount);
});
// Verify the payment is listed in the recipient's payment history
cy.getBySel('nav-personal-tab').click();
cy.contains(paymentNote).should('be.visible');
